import React from "react";

const NewTaskForm = ({ addTask }) => {
  return (
    <header className="header">
      <h1>todos</h1>
      <input
        className="new-todo"
        placeholder="What needs to be done?"
        autoFocus
      />
      <button className="add-btn" onClick={() => addTask("Hi! Mazafaka")}>
        Add to list
      </button>
    </header>
  );
};

export default NewTaskForm;
